	@Test(groups = { "default" }, enabled = false)
	public void loadSimulations() throws Exception {
		ApplicationContext ctx = new ClassPathXmlApplicationContext(
				"classpath:SifemCore-applicationContext.xml");
		ISimulationProcessManagerDAO simulationProcessManagerDAO = (ISimulationProcessManagerDAO) ctx
				.getBean("simulationProcessManagerDAO");

		SimulationProcessManagerTO simulationProcessManagerTO = new SimulationProcessManagerTO();
		simulationProcessManagerTO.setSimulationName("Simulation");
		simulationProcessManagerTO
				.setSimulationInstanceName(new ArrayList<String>());
		String instancePrefixName = "Instance_";
		String urlPrefixName = "http://www.sifemontologies.com/ontologies/";
		for (int i = 0; i <= 10; i++) {
			String instanceFullName = "<" + urlPrefixName
					+ simulationProcessManagerTO.getSimulationName() + "/"
					+ instancePrefixName + i + ">";
			System.out.println(instanceFullName);
			simulationProcessManagerTO.getSimulationInstanceName().add(
					instanceFullName);
		}
		simulationProcessManagerDAO.insert(simulationProcessManagerTO);
		System.out.println("DONE");
	}

